import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

//Components
import { FutHeaderComponent } from './fut-header/fut-header.component';
import { FutSearchComponent } from './fut-search/fut-search.component';
import { FutListComponent } from './fut-list/fut-list.component';
import { RouterModule } from '@angular/router';
import { FutCardDetailsComponent } from './fut-card-details/fut-card-details.component';
import { PagesModule } from "../pages/pages.module";



@NgModule({
    declarations: [
        FutHeaderComponent,
        FutSearchComponent,
        FutListComponent

    ],
    exports: [
        FutHeaderComponent,
        FutSearchComponent,
        FutListComponent,
        FutCardDetailsComponent
    ],
    imports: [
        CommonModule,
        RouterModule,
        PagesModule
    ]
})
export class SharedModule { }
